import './App.css';
import Header from './components/Header';
import NotesListPage from './pages/NotesListPage';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";


const router = createBrowserRouter([
  {
    path: "/",
    element: <NotesListPage />
  },
]);


function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <RouterProvider router={router} />
      </div>
    </Router>
  );
}

export default App;
